import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Climbing App - Laumont Lucien</h1>
      </header>
      <div className="content">
        <div className="box left-box">
          <p>Paragraphe de présentation perso</p>
        </div>
        <div className="box right-box">
          <p>Paragraphe de présentation du projet</p>
        </div>
      </div>
    </div>
  );
}

export default App;
